import users from "../data/user_list.json"

const getUserData = () => {
  let i = 0;
  let searchUser = [];

  users['users'].forEach(user => {
    const container = require(`../data/users/${user}.json`);
    const changeName = container => !container ? "" : container

    if (container.resources[0].data.primaryExtension.pattern === null) {
      container.resources[0].data.primaryExtension.pattern = ""
    }

    console.log(container.resources[0].data.primaryExtension.pattern)

    searchUser.push([
      {
        key: i,
        type: "id",
        data: changeName(container.resources[0].data.userid)
      },
      {
        key: i,
        type: "name",
        data: changeName(container.resources[0].data.displayName)
      },
      {
        key: i,
        type: "primary",
        data: changeName(container.resources[0].data.primaryExtension.pattern)
      }
    ])
  })

  return searchUser
}

export default getUserData();
